import Product from "../components/Product"
import "./Catalog.css"

function Catalog(){
    
    const products = [
    { 
        title: "Mouse",
        price: 15,
        image: "mouse.jpg",
        category: "accesories",
        _id:"1"
    },
    {
        title: "Keyboard",
        price: 30,
        image: "keyboard.jpg",
        category: "accesories",
        _id:"2"
    },
    {
        title: "Monitor",
        price: 350,
        image: "monitor.jpg",
        category: "accesories",
        _id:"3"
    },
    {
        title: "ApexDesk FLex",
        price: 649,
        image: "apexdesk.jpg",
        category: "accesories",
        _id:"4"
    },
    {
        title: "Mouse Pad",
        price: 25,
        image: "mousepad.jpg",
        category: "accesories",
        _id:"5"
    },
    {
        title: "Router",
        price: 157,
        image: "router.jpg",
        category: "accesories",
        _id:"6"
    },
    {
        title: "SSD",
        price: 50,
        image: "SSD.jpg",
        category: "accesories",
        _id:"7"
    },
];    
    return(
        <div className="catalog">
            <h2>CHECK OUR AMAZING CATALOG!</h2>

            <div className="products">
                <Product data = {products[0]} />  
                <Product data = {products[1]}/>  
                <Product data = {products[2]}/>  
                <Product data = {products[3]}/>  
                <Product data = {products[4]}/>  
                <Product data = {products[5]}/>  
                <Product data = {products[6]}/>  
            </div>
        </div>
    );
}

export default Catalog;
